import ForceGraph2D from 'react-force-graph-2d';
import React, { useContext, useState, useEffect} from 'react';
import test from './datasets/test.json'

function forceGraph() {
    let data = test
    console.log(data)
    return (

        <>
        <ForceGraph2D
          graphData={data}
          nodeLabel="id"
          nodeAutoColorBy="group"
          linkVisibility ={true}
          onNodeDragEnd={node => {
            node.fx = node.x;
            node.fy = node.y;
            node.fz = node.z;
          }}
            />
        </>
      );
    }

    export default forceGraph;
